const contains = (a, b) => {
	const len = a.length;

	for (let i = 0; i < len; ++i) {
		if (b === a[i]) {
			return true;
		}
	}

	return false;
};

export default contains;

const countOf = (a, b) => {
	let n = 0;
	const len = a.length;

	for (let i = 0; i < len; ++i) {
		if (b === a[i]) {
			++n;
		}
	}

	return n;
};

export default countOf;

const iconcat = (a, b) => {
	const len = b.length;

	for (let i = 0; i < len; ++i) {
		a.push(b[i]);
	}

	return a;
};

export default iconcat;

const indexOf = (a, b) => {
	const len = a.length;

	for (let i = 0; i < len; ++i) {
		if (b === a[i]) {
			return i;
		}
	}

	return -1;
};

