import noop from '../fn/noop.js';
import attrresolve from './attrresolve.js';

const attrgetter = (...args) => {
	const len = args.length;

	if (len === 0) return noop;

	if (len === 1) {
		const attr = args[0];
		return (obj) => attrresolve(obj, attr);
	}

	return (obj) => {
		const tuple = [];

		for (let i = 0; i < len; ++i) {
			tuple.push(attrresolve(obj, args[i]));
		}

		return tuple;
	};
};

export default attrgetter;

const attrresolve = (obj, attr) => {
	const parts = attr.split('.');

	const len = parts.length;

	for (let i = 0; i < len; ++i) {
		const name = parts[i];
		obj = obj[name];
	}

	return obj;
};

export default attrresolve;

const delitem = (a, b) => {
	delete a[b];
};

export default delitem;

import noop from '../fn/noop.js';

const itemgetter = (...args) => {
	const len = args.length;

	if (len === 0) return noop;

	if (len === 1) {
		const attr = args[0];
		return (obj) => obj[attr];
	}

	return (obj) => {
		const tuple = [];

		for (let i = 0; i < len; ++i) {
			tuple.push(obj[args[i]]);
		}

		return tuple;
	};
};

export default itemgetter;

const setitem = (a, b, c) => {
	a[b] = c;
};

export default setitem;

